import React from 'react';

export const FilmList = ({ nameList }) => {
  const films = nameList.films;
  const name = nameList.name;
  if (name !== undefined) {
    console.log(name);
    console.log(films);
  }

  return (
    <div className="text-yellow-500 font-bold">
      <h2> Personaje: {}</h2>
      <h2>Peliculas en las que participa:</h2>
      <ul></ul>
    </div>
  );
};
